import React from "react";
import logo from "../assets/Logos/logo.png"
import "./Header.css";
import { TabPanel, useTabs } from '../../src';
import { TabSelector } from './TabSelector';

import {
    Background,
    Logo,
    Menu,
    P,
    ItemMenu,
    // PointeurMenu
} from "/Users/mariegarde/Desktop/Projet - perso/Loudher/frontend/src/styled-components/Header.jsx";

export default function Header () {

    const [selectedTab, setSelectedTab] = useTabs([
        'account',
        'company',
        'team',
        'billing',
      ]);
    return (
        <>
        <Background>
            <Logo src={logo}></Logo>
            <nav className="flex border-b border-gray-300">
        <TabSelector
          isActive={selectedTab === 'account'}
          onClick={() => setSelectedTab('account')}
        >
          My Account
        </TabSelector>
        <TabSelector
          isActive={selectedTab === 'company'}
          onClick={() => setSelectedTab('company')}
        >
          Company
        </TabSelector>
        <TabSelector
          isActive={selectedTab === 'team'}
          onClick={() => setSelectedTab('team')}
        >
          Team Members
        </TabSelector>
        <TabSelector
          isActive={selectedTab === 'billing'}
          onClick={() => setSelectedTab('billing')}
        >
          Billing
        </TabSelector>
      </nav>
      <div className="p-4">
        <TabPanel hidden={selectedTab !== 'account'}>My Account</TabPanel>
        <TabPanel hidden={selectedTab !== 'company'}>Company</TabPanel>
        <TabPanel hidden={selectedTab !== 'team'}>Team Members</TabPanel>
        <TabPanel hidden={selectedTab !== 'billing'}>Billing</TabPanel>
      </div>
        </Background>
        </>

    )
}
